import logo from './logo.svg';
import './App.css';
import { Component } from 'react';

class App extends Component {
  constructor() {
    super();

    this.state = {

    monsters: []

    };
    }

    componentDidMount() {
      fetch('https://jsonplaceholder.typicode.com/users') 
      .then(response => response.json())
      .then(users => this.setState({monsters: users +1}));
    }

   render() {
return (
        <div className="App">
          {
            this.state.monsters.map(monster => 
            <h1 key={monster}>{monster.name}</h1>

            )

          }
          </div>
);
   }
}

export default App;
